import Card from 'react-bootstrap/Card';
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'


const variantsBg = ["info","primary","secondary","success","danger","warning","info"]

const randomBg = () => {
    return variantsBg[Math.floor(Math.random() * variantsBg.length)];
}

const Text = props => {
    return (

        <div className="card text-dark bg-warning mb-3" style="max-width: 18rem;">
            <div className="card-header">Header</div>
            <div class="card-body">
                <h5 class="card-title">{props.title}</h5>
                <p class="card-text">{props.text}</p>
            </div>
        </div>
        )
}

export default Text;
